import { createApp } from 'vue'
// import App from './App.vue'
import ProjectC from './ProjectC.vue'

function generateRandomValues(max, min){
    return Math.floor(Math.round()*(12 - 5)) + 5;
}

createApp(ProjectC).mount('#app')
